def find_snake_positions(n, query_function):

    def f(c, n):
        low = 1
        high = n
        while high > low:
            mid = (high + low) // 2
            if query_function(c, low, c, mid) % 2 == 1:
                high = mid
            else:
                low = mid + 1
        return (c, low)

    def g(c, n):
        low = 1
        high = n
        while high > low:
            mid = (high + low) // 2
            if query_function(low, c, mid, c) % 2 == 1:
                high = mid
            else:
                low = mid + 1
        return (low, c)
    rs = []
    for i in range(n):
        if query_function(i + 1, 1, i + 1, n) % 2 == 1:
            rs.append(f(i + 1, n))
        if len(rs) == 2:
            return tuple(rs)
    for i in range(n - 1):
        if query_function(1, i + 1, n, i + 1) % 2 == 1:
            rs.append(g(i + 1, n))
        if len(rs) == 2:
            return tuple(rs)
    rs.append(g(n, n))
    if len(rs) != 2:
        return tuple(rs)

